import React from 'react';
import Slider from "react-slick";
import bootstrapcarsoule from "../../asstes/images/newyark.jpg";
import bootstrapcarsoule1 from "../../asstes/images/PK.png";
import bootstrapcarsoule2 from "../../asstes/images/RCB.png";


const carouselImages = [
  bootstrapcarsoule,
  bootstrapcarsoule1,
  bootstrapcarsoule2,
];

const centerCarouselImages = [
  bootstrapcarsoule1,
  bootstrapcarsoule2,
];

const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  arrows: true,
};

const BootstrapCarousel = () => {
  return (
      <div className="triple-carousel-container">
      {/* Left Carousel */}
      <div className="carousel-box">
        <Slider {...settings}>
          {carouselImages.map((img, idx) => (
            <div key={idx}>
              <img src={img} alt={`Left ${idx}`} />
            </div>
          ))}
        </Slider>
      </div>

      {/* Center Carousel */}
      <div className="carousel-box center-carousel">
        <Slider {...settings}>
          {centerCarouselImages.map((img, idx) => (
            <div key={idx}>
              <img src={img} alt={`Center ${idx}`} />
            </div>
          ))}
        </Slider>
      </div>

      {/* Right Carousel */}
      <div className="carousel-box">
        <Slider {...settings}>
          {carouselImages.map((img, idx) => (
            <div key={idx}>
              <img src={img} alt={`Right ${idx}`} />
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default BootstrapCarousel;
